(In reply to comment #36)
> In Block.java, I would save locals[i] into a local variable to prevent three
> accesses into the array for each local.

And while we're at it, the same snippet:

	int numLocals = locals != null ? locals.length : 0;
	for (int i = 0; i < numLocals; i++) {
		if (locals[i] != null && !this.scope.parent.hasLocal(locals[i].id))
			flowInfo.resetAssignmentInfo(locals[i]);
	}

raises an uninteresting pot.npe warning (if enabled). It's a pattern I plan to eliminate so we can eventually enable the warning. Please use s.t. like this instead (both suggestions combined):

	if (locals != null) {
		int numLocals = locals.length;
		for (int i = 0; i < numLocals; i++) {
			LocalVariableBinding local = locals[i];
			if (local != null && !this.scope.parent.hasLocal(local.id))
				flowInfo.resetAssignmentInfo(local);
		}
	}

Additionally, locals.length could probably be replaced with this.scope.localIndex to avoid looping over empty array slots - should even obsolete the null-check, pls. cf. other uses in BlockScope.

